// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "../node_modules/@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";

contract ProxyCopyright is ERC721 {
    address public Copyright;
    address private owner;

    mapping(uint256 => string) private _tokenUris;

    mapping(uint => UsageInfo) internal copyrightInfoMap;

    struct UsageInfo {
        uint buyCnt;
        uint mintCnt;
        uint downloadCnt;
        bool sellYn;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the contract owner can call this function");
        _;
    }

    modifier onlyNftOwner(uint copyrightId) {
        require(msg.sender == ownerOf(copyrightId), "Only the nft owner can call this function");
        _;
    }

    constructor(address _newCopyright) {
        Copyright = _newCopyright;
    }

    function setImplementation(address _newCopyright) public {
        // Add proper access controls in production
        Copyright = _newCopyright;
    }
// (bool success, bytes memory result) = Copyright.delegatecall(abi.encodeWithSignature("getUsageInfo(uint 256)", copyrightId)); 
//  return abi.decode(result, (UsageInfo));
    function getUsageInfo(uint copyrightId) public view returns (UsageInfo memory) {
        return copyrightInfoMap[copyrightId];
    }

    function tokenURI(uint256 copyrightId) public view virtual override returns (string memory) {
        _checkExistsToken(copyrightId);
        return _tokenUris[copyrightId];
    }

    // Change copyright available. You can stop or start the sale.
    function modifySellYnDelegateCall(uint copyrightId, bool sellYn) public onlyNftOwner(copyrightId) {
        (bool success, bytes memory result) = Copyright.delegatecall(abi.encodeWithSignature("modifySellYn(uint256, bool)", copyrightId, sellYn));
        require(success = true, "Failed delegatecall...");
    }

    function modifyTokenUriDelegateCall(uint copyrightId, string memory tokenUri) public onlyNftOwner(copyrightId) {
        (bool success, bytes memory result) = Copyright.delegatecall(abi.encodeWithSignature("modifyTokenUri(uint256, string)", copyrightId, tokenUri));
        require(success = true, "Failed delegatecall...");
    }

    /**
     * @dev After deploy, you need to call this function and set the DownloadTicket.sol address.
     */
    function setDtAddressDelegateCall(address downloadContractAddress) public {
        (bool success, bytes memory result) = Copyright.delegatecall(abi.encodeWithSignature("setDtAddress(address)", downloadContractAddress));
        require(success = true, "Failed delegatecall...");
    }

    // Copyright NFT minting.
    function mintCopyrightDelegateCall(uint copyrightId, string memory tokenUri, bool sellYn) public {
        (bool success, bytes memory result) = Copyright.delegatecall(abi.encodeWithSignature("mintCopyright(uint256, string, bool)", copyrightId, tokenUri, sellYn));
        require(success = true, "Failed delegatecall...");
    }

    // Download ticket minting.
    function buyDownloadTicketDelegateCall(uint copyrightId, uint counter, uint price, string memory tokenUri) public {
        //require(msg.sender == ownerOf(copyrightId), "Only Copyright owner can mint the tickets!");
        (bool success, bytes memory result) = Copyright.delegatecall(abi.encodeWithSignature("buyDownloadTicket(uint256, uint256, uint256, string)", copyrightId, counter, price));
        require(success = true, "Failed delegatecall...");
    }

    // Use the download ticket.
    function useDownloadDelegateCall(uint copyrightId) public {
        (bool success, bytes memory result) = Copyright.delegatecall(abi.encodeWithSignature("useDownload(uint256)", copyrightId));
        require(success = true, "Failed delegatecall...");
    }

    function modifyDownloadTokenUriDelegateCall(uint downloadId, string memory tokenUri) public {
        //require(msg.sender == ownerOf(download.getDownloadInfo(downloadId).copyrightId));
        (bool success, bytes memory result) = Copyright.delegatecall(abi.encodeWithSignature("modifyDownloadTokenUri(uint256, string)", downloadId, tokenUri));
        require(success = true, "Failed delegatecall...");
    }

    function modifyDownloadTotalCntDelegateCall(uint downloadId, uint totalCnt) public {
        //require(msg.sender == ownerOf(download.getDownloadInfo(downloadId).copyrightId));
        (bool success, bytes memory result) = Copyright.delegatecall(abi.encodeWithSignature("modifyDownloadTokenCnt(uint256, uint256)", downloadId, totalCnt));
        require(success = true, "Failed delegatecall...");
    }

    // private function
    function _checkExistsToken(uint256 tokenId) private view {
        require(_exists(tokenId), "Token not exists.");
    }

    function _exists(uint256 tokenId) internal view virtual returns (bool) {
        return _ownerOf(tokenId) != address(0);
    }
}
